import React, { useState, useEffect } from 'react';
import { useAuth } from '../context/AuthContext';
import './AdminDashboard.css';

const AdminDashboard = () => {
  const { user, logout } = useAuth();
  const [stats, setStats] = useState({
    totalUsers: 0,
    totalInvestments: 0,
    totalDeposits: 0,
    totalWithdrawals: 0,
    activeInvestments: 0,
    pendingWithdrawals: 0
  });
  const [users, setUsers] = useState([]);
  const [investments, setInvestments] = useState([]);
  const [transactions, setTransactions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [activeTab, setActiveTab] = useState('overview');

  useEffect(() => {
    loadAdminData();
  }, []);

  const loadAdminData = async () => {
    setLoading(true);
    try {
      // Simulate admin data loading
      setTimeout(() => {
        setStats({
          totalUsers: 156,
          totalInvestments: 89,
          totalDeposits: 2450000,
          totalWithdrawals: 890000,
          activeInvestments: 67,
          pendingWithdrawals: 12
        });

        setUsers([
          { id: 1, name: 'John Doe', email: 'john@example.com', status: 'Active', joinDate: '2024-01-15' },
          { id: 2, name: 'Jane Smith', email: 'jane@example.com', status: 'Active', joinDate: '2024-01-20' },
          { id: 3, name: 'Mike Johnson', email: 'mike@example.com', status: 'Inactive', joinDate: '2024-01-25' }
        ]);

        setInvestments([
          { id: 1, userId: 1, userName: 'John Doe', amount: 50000, package: 'Premium', status: 'Active', date: '2024-01-16' },
          { id: 2, userId: 2, userName: 'Jane Smith', amount: 25000, package: 'Standard', status: 'Active', date: '2024-01-21' },
          { id: 3, userId: 3, userName: 'Mike Johnson', amount: 100000, package: 'VIP', status: 'Completed', date: '2024-01-26' }
        ]);

        setTransactions([
          { id: 1, userId: 1, userName: 'John Doe', type: 'Deposit', amount: 50000, status: 'Completed', date: '2024-01-16' },
          { id: 2, userId: 2, userName: 'Jane Smith', type: 'Withdrawal', amount: 15000, status: 'Pending', date: '2024-01-22' },
          { id: 3, userId: 3, userName: 'Mike Johnson', type: 'Deposit', amount: 100000, status: 'Completed', date: '2024-01-26' }
        ]);

        setLoading(false);
      }, 1000);
    } catch (error) {
      console.error('Error loading admin data:', error);
      setLoading(false);
    }
  };

  const formatCurrency = (amount) => {
    return new Intl.NumberFormat('en-PH', {
      style: 'currency',
      currency: 'PHP'
    }).format(amount);
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString('en-PH');
  };

  const handleUserAction = (userId, action) => {
    console.log(`${action} user ${userId}`);
    // Implement user actions (activate, deactivate, etc.)
  };

  const handleTransactionAction = (transactionId, action) => {
    console.log(`${action} transaction ${transactionId}`);
    // Implement transaction actions (approve, reject, etc.)
  };

  if (loading) {
    return (
      <div className="admin-dashboard">
        <div className="loading-spinner">
          <div className="spinner"></div>
          <p>Loading admin dashboard...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="admin-dashboard">
      <div className="admin-header">
        <div className="admin-title">
          <h1>Admin Dashboard</h1>
          <p>Welcome back, {user?.name}</p>
        </div>
        <div className="admin-actions">
          <button onClick={logout} className="logout-btn">
            Logout
          </button>
        </div>
      </div>

      <div className="admin-tabs">
        <button 
          className={`tab-btn ${activeTab === 'overview' ? 'active' : ''}`}
          onClick={() => setActiveTab('overview')}
        >
          Overview
        </button>
        <button 
          className={`tab-btn ${activeTab === 'users' ? 'active' : ''}`}
          onClick={() => setActiveTab('users')}
        >
          Users
        </button>
        <button 
          className={`tab-btn ${activeTab === 'investments' ? 'active' : ''}`}
          onClick={() => setActiveTab('investments')}
        >
          Investments
        </button>
        <button 
          className={`tab-btn ${activeTab === 'transactions' ? 'active' : ''}`}
          onClick={() => setActiveTab('transactions')}
        >
          Transactions
        </button>
      </div>

      <div className="admin-content">
        {activeTab === 'overview' && (
          <div className="overview-section">
            <div className="stats-grid">
              <div className="stat-card">
                <div className="stat-icon users-icon">👥</div>
                <div className="stat-info">
                  <h3>{stats.totalUsers}</h3>
                  <p>Total Users</p>
                </div>
              </div>
              <div className="stat-card">
                <div className="stat-icon investments-icon">💼</div>
                <div className="stat-info">
                  <h3>{stats.totalInvestments}</h3>
                  <p>Total Investments</p>
                </div>
              </div>
              <div className="stat-card">
                <div className="stat-icon deposits-icon">💰</div>
                <div className="stat-info">
                  <h3>{formatCurrency(stats.totalDeposits)}</h3>
                  <p>Total Deposits</p>
                </div>
              </div>
              <div className="stat-card">
                <div className="stat-icon withdrawals-icon">💸</div>
                <div className="stat-info">
                  <h3>{formatCurrency(stats.totalWithdrawals)}</h3>
                  <p>Total Withdrawals</p>
                </div>
              </div>
              <div className="stat-card">
                <div className="stat-icon active-icon">🔥</div>
                <div className="stat-info">
                  <h3>{stats.activeInvestments}</h3>
                  <p>Active Investments</p>
                </div>
              </div>
              <div className="stat-card">
                <div className="stat-icon pending-icon">⏳</div>
                <div className="stat-info">
                  <h3>{stats.pendingWithdrawals}</h3>
                  <p>Pending Withdrawals</p>
                </div>
              </div>
            </div>
          </div>
        )}

        {activeTab === 'users' && (
          <div className="users-section">
            <div className="section-header">
              <h2>User Management</h2>
              <button className="add-btn">Add User</button>
            </div>
            <div className="table-container">
              <table className="admin-table">
                <thead>
                  <tr>
                    <th>ID</th>
                    <th>Name</th>
                    <th>Email</th>
                    <th>Status</th>
                    <th>Join Date</th>
                    <th>Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {users.map(user => (
                    <tr key={user.id}>
                      <td>{user.id}</td>
                      <td>{user.name}</td>
                      <td>{user.email}</td>
                      <td>
                        <span className={`status ${user.status.toLowerCase()}`}>
                          {user.status}
                        </span>
                      </td>
                      <td>{formatDate(user.joinDate)}</td>
                      <td>
                        <button 
                          className="action-btn edit"
                          onClick={() => handleUserAction(user.id, 'edit')}
                        >
                          Edit
                        </button>
                        <button 
                          className="action-btn delete"
                          onClick={() => handleUserAction(user.id, 'delete')}
                        >
                          Delete
                        </button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        )}

        {activeTab === 'investments' && (
          <div className="investments-section">
            <div className="section-header">
              <h2>Investment Management</h2>
            </div>
            <div className="table-container">
              <table className="admin-table">
                <thead>
                  <tr>
                    <th>ID</th>
                    <th>User</th>
                    <th>Amount</th>
                    <th>Package</th>
                    <th>Status</th>
                    <th>Date</th>
                    <th>Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {investments.map(investment => (
                    <tr key={investment.id}>
                      <td>{investment.id}</td>
                      <td>{investment.userName}</td>
                      <td>{formatCurrency(investment.amount)}</td>
                      <td>{investment.package}</td>
                      <td>
                        <span className={`status ${investment.status.toLowerCase()}`}>
                          {investment.status}
                        </span>
                      </td>
                      <td>{formatDate(investment.date)}</td>
                      <td>
                        <button 
                          className="action-btn view"
                          onClick={() => handleUserAction(investment.id, 'view')}
                        >
                          View
                        </button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        )}

        {activeTab === 'transactions' && (
          <div className="transactions-section">
            <div className="section-header">
              <h2>Transaction Management</h2>
            </div>
            <div className="table-container">
              <table className="admin-table">
                <thead>
                  <tr>
                    <th>ID</th>
                    <th>User</th>
                    <th>Type</th>
                    <th>Amount</th>
                    <th>Status</th>
                    <th>Date</th>
                    <th>Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {transactions.map(transaction => (
                    <tr key={transaction.id}>
                      <td>{transaction.id}</td>
                      <td>{transaction.userName}</td>
                      <td>
                        <span className={`type ${transaction.type.toLowerCase()}`}>
                          {transaction.type}
                        </span>
                      </td>
                      <td>{formatCurrency(transaction.amount)}</td>
                      <td>
                        <span className={`status ${transaction.status.toLowerCase()}`}>
                          {transaction.status}
                        </span>
                      </td>
                      <td>{formatDate(transaction.date)}</td>
                      <td>
                        {transaction.status === 'Pending' && (
                          <>
                            <button 
                              className="action-btn approve"
                              onClick={() => handleTransactionAction(transaction.id, 'approve')}
                            >
                              Approve
                            </button>
                            <button 
                              className="action-btn reject"
                              onClick={() => handleTransactionAction(transaction.id, 'reject')}
                            >
                              Reject
                            </button>
                          </>
                        )}
                        {transaction.status !== 'Pending' && (
                          <button 
                            className="action-btn view"
                            onClick={() => handleTransactionAction(transaction.id, 'view')}
                          >
                            View
                          </button>
                        )}
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default AdminDashboard;
